return ['x-generator'=>'GlotPress/4.0.1','translation-revision-date'=>'2024-11-17 20:46:54+0000','plural-forms'=>'nplurals=2; plural=n != 1;','project-id-version'=>'Themes - Twenty Twenty-Four','language'=>'sq_AL','messages'=>['Twenty Twenty-Four is designed to be flexible, versatile and applicable to any website. Its collection of templates and patterns tailor to different needs, such as presenting a business, blogging and writing or showcasing work. A multitude of possibilities open up with just a few adjustments to color and typography. Twenty Twenty-Four comes with style variations and full page designs to help speed up the site building process, is fully compatible with the site editor, and takes advantage of new design tools introduced in WordPress 6.4.'=>'Twenty Twenty-Four është hartuar për të qenë e epshme, e zhdërvjellët dhe e zbatueshme për çfarëdo sajti. Koleksioni i saj i gjedheve dhe modeleve u bën punë nevojave të ndryshme, fjala vjen, paraqitjes së një biznesi, blogimit dhe shkrimit, apo paraqitje punësh. Vetëm pak përimtime ngjyre dhe tipografie hapin një shumicë mundësish. Twenty Twenty-Four vjen me variante stilesh dhe skema të plota faqesh, për t’ju ndihmuar të përshpejtoni procesin e ndërtimit të sajtit, është plotësisht e përputhshme me përpunuesin e sajteve dhe përfiton nga mjete të reja hartimi të sjella nga WordPress 6.4.','Twenty Twenty-Four'=>'Twenty Twenty-Four','Pattern descriptionA centered text statement with a large amount of padding on all sides.'=>'Një pohim tekst, në qendër, me një sasi të madhe mbushjeje në tërë anët.','Pattern titlePosts heading'=>'Krye postimi','Pattern descriptionA title, a paragraph and a CTA button on the left with an image on the right.'=>'Një titull, një paragraf dhe një buton ThPV në të majtë, me një figurë në të djathtë.','Pattern descriptionA text-only section for project details.'=>'Një ndarje vetëm për tekst, për hollësi projekti.','Pattern descriptionA feature grid of 2 rows and 3 columns with he